import React from 'react';
import Header from './Header'; // Header 컴포넌트 불러오기
import './App.css'; // App 전체 스타일을 위한 CSS 불러오기

function App() {
    return (
        <div className="app">
            <Header />
            <img src="main.png" alt="Main Content" className="mainImage" />
            <button className="mainImageButton">내 영상 분석하기</button>
        </div>
    );
}

export default App;
